import Navbar from "../components/Navbar";
function About(){
    return(
    <>
    <Navbar/>
      <Hero
        cName="hero"
        buttonText="Grow your business with us"
        url="/"
        btnClass="show"
      />
    
    <h1>
            This is an about page.
        </h1>
    </>
  )

}

export default About;
